import React from "react";
import "../style.css";
import {useHistory} from "react-router-dom";

function NextBtn() {


    const history = useHistory();
    return (
        <div className="btnNext">
        <button onClick={history.push("/schedule")}className="btnNext">Book</button>
        </div>
    )
}

export default NextBtn;
